import React, { useEffect, useState } from "react";
import Header from "./Header";
import NotFound from "./NotFound";
import {
  BrowserRouter as Router,
  Link,
  NavLink,
  Route,
  Switch,
  useLocation,
  useHistory,
  useParams,
  useRouteMatch,
} from "react-router-dom";

function Home() {
  return (
    <div class="card">
      <div class="card-header">Featured</div>
      <div class="card-body">
        <h5 class="card-title">Rendering in React</h5>
        <p class="card-text">
          React's component structure allows for quickly buildign a complex web
          application that relies on DOM manipulation.
        </p>
        <a href="#" class="btn btn-primary">
          View
        </a>
        <a href="#" class="btn btn-primary">
          Study
        </a>
        <a href="#" class="btn btn-danger">
          Trash Can Icon
        </a>
      </div>
    </div>
  );
}

export default Home;
